import 'bootstrap/dist/css/bootstrap.css';
import { useParams } from "react-router-dom";

function EditExcel() {

    function edit(e){
        e.preventDefault()
        const param = useParams();

    }

    return (
        <div>
            <form class="m-5" onSubmit={edit}>
                <div class="mb-3">
                    <input type="actionType" class="form-control" placeholder='Action Type'></input>
                </div>
                <div class="mb-3">
                    <input type="actionName" class="form-control" placeholder='Action Name'></input>
                </div>
                <button type="submit" class="btn btn-primary">Save</button>
            </form>
        </div>
    );
}

export default EditExcel;
